  \"Hole-Initiated-Avalanche, Linear-Mode, Single-Photon-Sensitive Avalanche Photodetector
  with Reduced Excess Noise and Low Dark Count Rate Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 5,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T00:51:03.473694\",\n\t\"name\": \"hole-initiated-avalanche-linear-mode-single-photon-sensitive-avalanche-photodetector-with-\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A radiation hard, single photon sensitive
  InGaAs avalanche photodiode (APD) receiver technology will be demonstrated useful
  for long range space based optical telecommunications in the spectral range from
  1000 to 1600 nm. The innovation is based on a linear mode (lm) single photon sensitive
  APD technology for which avalanche gain as high as M = 8000 has been demonstrated.
  Single photon detection efficiency (PDE) up to 80&#37; has been demonstrated at
  1064 nm, as well as maximum count rates in excess of 300 MHz. In the proposed effort,
  the dark count rate of these detectors will be reduced to the order of kHz while
  preserving PDE and maximum count rate. Detector dark current will be lowered by
  two orders of magnitude through implementation of the APD design using aluminum-free
  alloys with 100x lower trap density than the current design. In Phase I, a series
  of single element detectors of varying diameter, as well as small sized arrays,
  will be fabricated from the new aluminum-free material, and the corresponding decrease
  in dark count rate will be measured. In Phase II, radiation and lifetime testing
  will be repeated for the aluminum-free design, and large-area segmented detectors
  will be coupled to readout integrated circuits and demonstrated.rnVoxtel anticipates
  that its technology will enter the program at TRL=4, finish Phase I at TRL=5, and
  exit the Phase II program at TRL=6.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
